import React from 'react'

import './UserList.module.css'

const UserList = (props) => {
  return (
    <div className="users">
      <ul>
        {props.userData.map((user) => (
          <li>{`${user.name} (${user.age} years old)`}</li>
        ))}
      </ul>
    </div>
  )
}

export default UserList
